import React from 'react';

import './styleTing.css';

const StyleTing = props => {
    return (
        <React.Fragment>
            <div className="Name">
                {props.name}
            </div>

            <div>
                <form onSubmit={props.setCount}>
                    <input>

                    </input>
                </form>
            </div>

            <div>
                {props.count}
                {props.age}
            </div>

            <div>
                {props.job}
            </div>
        </React.Fragment>
    )
}

export default StyleTing;
